args.functionCode:
async () => {
  const defaultUrl = 'http://127.0.0.1:8081';
  const bundleURL = (process.env.EXPO_BUNDLE_URL || defaultUrl).trim();
  const params = new URLSearchParams({
    role: 'ciudadano',
    disableBypass: '1'
  }).toString();
  const devClientURL = `seguridadciudadanaapp://expo-development-client/?url=${encodeURIComponent(bundleURL)}&${params}`;
  try {
    await device.reverseTcpPort(8081);
  } catch (_) {}
  await device.launchApp({
    newInstance: true,
    launchArgs: {
      detoxEnableSynchronization: 0
    },
    url: devClientURL
  });
  await new Promise(r => setTimeout(r, 15000));
}

() => {
    if (config.resetModules) {
      runtime.resetModules();
    }
    if (config.clearMocks) {
      runtime.clearAllMocks();
    }
    if (config.resetMocks) {
      runtime.resetAllMocks();
      if (
        config.fakeTimers.enableGlobally &&
        config.fakeTimers.legacyFakeTimers
      ) {
        // during setup, this cannot be null (and it's fine to explode if it is)
        environment.fakeTimers.useFakeTimers();
      }
    }
    if (config.restoreMocks) {
      runtime.restoreAllMocks();
    }
  }

async () => {
    // Esperar a que aparezca el formulario de login con un timeout largo
    await waitFor(element(by.id('login-email'))).toBeVisible().withTimeout(30000);

    // Hacer tap en el botn de submit para activar el bypass (credenciales automticas)
    await element(by.id('login-submit')).tap();

    // Esperar a que aparezca el dashboard de autoridad
    await waitFor(element(by.id('dashboard-authority'))).toBeVisible().withTimeout(20000);

    // Abrir el sidebar
    await element(by.id('open-sidebar')).tap();

    // Esperar al botn de logout
    await waitFor(element(by.id('logout-button'))).toBeVisible().withTimeout(10000);

    // Hacer logout
    await element(by.id('logout-button')).tap();

    // Verificar que regresamos a la pantalla de login
    await waitFor(element(by.id('login-submit'))).toBeVisible().withTimeout(15000);
  }

